import React, {useState} from 'react';
import './App.css';

function App() {
  const [debug, setDebug] = useState(false)

  return (
    <div className="App">
      <button onClick={
        () => {setDebug(!debug)}
      }>Set Debug Outputs</button>
      <p>Debug state: {debug ? "True" : "False"}</p>
    </div>
  );
}

export default App;
